const MoviesLogic = (props) => {
    let header=props.title
    let favrates=props.data
    let handleRemove=props.fn
    return ( 
        <div className="fav">
             <h1>{header}</h1>
        <div className="fav">
            {favrates.map((data)=>(
             <div className="favratelist">
                <h2>{data.title}</h2>
                <p>{data.language}/{data.genre}</p>
                <p>{data.rating}‚≠ê</p>
                <p>{data.id}</p>
                <button onClick={() => handleRemove(data.id)} >Remove</button>
             </div>
            ))}
        </div>

        </div>

     );
}
 
export default moviesLogic;
